    return this._code
  }

  get name() {
    return this._name
  }

  set name(Name) {
    if (typeof Name !== 'string') throw TypeError('Name must be a string');
    this._name = Name;
  }

  set code(Code) {
    if (typeof Code !== 'string') throw TypeError('Code must be a string');
    this._code = Code;
  }

  displayFullCurrency() {
    return `${this._name} (${this._code})`;
  }
}
